const int MOD=1000000007;
LL Ext_gcd(LL a,LL b,LL &x,LL &y){
    if(b==0) { x=1, y=0; return a; }
    LL ret= Ext_gcd(b,a%b,y,x);
    y-= a/b*x;
    return ret;
}

LL Inv(LL a,int m){   //
    LL d,x,y,t= (LL)m;
    d= Ext_gcd(a,t,x,y);
    if(d==1) return (x%t+t)%t;
    return -1;
}

const int N=50005;

LL C[N],p[N];

void gao(LL n,LL k){
	p[0]=1;
	for(int i=1;i<=k+1;++i)
		p[i]=(p[i-1]*((n+1)%MOD))%MOD;
	LL ans=0;
	C[0]=1;
	for(int i=0;i<=k;++i){
		if(i) C[i]=(C[i-1]*(k+1-(i-1))%MOD*Inv(i,MOD)%MOD+MOD)%MOD;
		ans=(ans+C[i]*B[i]%MOD*p[k+1-i])%MOD;
	}
	ans=(ans*Inv(k+1,MOD)%MOD+MOD)%MOD;
	printf("%I64d\n",ans);
}

